import React from "react";

export const Statistics =({good, bad, neutral, total, positivePercentage})=> {

   return 
   <div className="Statistics"> 
    <ul>
        <li>Good: {good}</li>
        <li>Neutral: {neutral}</li>
        <li>Bad: {bad}</li>
        <li>Total: {total}</li>
        <li>Positive feedback: {positivePercentage}%</li>
    </ul>}
</div>    
}
